window.bookSummaryJSON = "<p>Demon Accords, number 17.&nbsp;</p> <p>Chris Gordon and Tanya Demidova are the world's top close quarters battle experts. As fast and powerful as elder vampires, with supernatural weapons that match their supernatural speed, strength, and senses. But how does a close quarters warrior fight an enemy that is literally light years away - 25,000 light years away?</p> <p>It would take one hell of a ranged weapon, something that can cross unimaginable distances with unfathomable power. Something...or...someone. Hmm, but witch is best?</p>"; 
